import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header>
        <h1>To Do List:</h1>
        <form id="add-todo-form">

          <label for="add">Add Item:</label>
          <input name="add" type="text"/>
          <input className="submit" type="submit" value="Add"></input>
        </form>
      </header>
    </div>
  );
}

export default App;
